('2428','15','7937','Concha, Kikko Roig',Null,'Finca mit 150.000m² Land in Paguera zu verkaufen','34067','Die Finca wurde 1990 saniert und erweitert. Sie hat auf einer Ebene ca 175m² Wohnfläche, die sich auf Wohn-Esszimmer, Küche, 3 Schlafzimmer und 3 Badezimmer verteilen. Der Außenbereich bietet großzügige überdachte und freie Terrassen sowie ein Pool. Ein Carrport für 3 Autos ist vorhanden. Kostenloses Wasser wird vom öffentlichen Wasserwerk zu Verfügung gestellt, da eine Hauptwasserleitung durch das Grundstück führt. Ein großer Teil des 150.000m² großen Grundstücks wir landwirtschaftlich genutzt.  Die nahegelegene Schnellstrasse Paguera –Andratx ist zu hören','34068','1800000','106','2016-02-19 11:57:36','106','2016-02-19 11:59:12',Null,'2567','104','1204',1,'1','0',Null,Null,Null,'34069',Null,'0','0','0',Null,'2016-02-19 12:04:49',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'34070',Null,'34071',Null,'34072',Null,'34073','610 445 907       971 685521','34074','0',0,'0');
